import React from "react";
import Card from "./Card";
import contacts from "./contacts";

function App() 

{
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      
      
      
      {
      contacts.map((contact) => // This was very confusing to do and seems like a very backwards way of acheiving this. I do not like React.
      
      <Card
      name={contact.name}
      img={contact.imgURL}
      tel={contact.phone}
      email={contact.email}
      link={contact.link}
    />


      )
      
    }

    
    
    </div>
  );
}


export default App;
